export default (function(a,b){return {data:{pQ6K12O5aa:{data:{id:2534,attributes:{imdbId:"tt0049830",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZTIzMWJhYjgtMzFhZC00N2UzLTljNWMtNDJlZThkNjBjMDhiXkEyXkFqcGdeQXVyNjUwNzk3NDc@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.8\u002F10"},{Source:"Rotten Tomatoes",Value:"86%"}],item_lang:{data:{id:3197,attributes:{title:a,plot:"This comedy-drama is partially a gentle satire on America's drive to change the world in the post-war years. One year after World War II, Captain Fisby is sent to the village of Tobiki in Okinawa to teach the people democracy. The first step is to build a school -- but the wily Okinawans know what they really want. They tell him about their culture and traditions -- and persuade him to build something they really want instead: a teahouse. Fisby has a hard time breaking this news to his superiors.",slug:"the-teahouse-of-the-august-moon"}}},books:{data:[{id:12188,attributes:{title:a,description:"Lighthearted novel about the village of Tobiki on Okinawa and a native houseboy who swings \"big deals\". Points out tendency of Americans to think of democracy only in terms of American institutions.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=En9AAAAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Vern Sneider"],firstBook:true,published:"1951-01-01",publisher:b,subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940914409}}("The Teahouse of the August Moon",""))